  }
};

const getUserById = async (id) => {
  try {
    let user = {};
    user = await db.UserApp.findOne({
      where: { id: id },
    });
    console.log(user.get({ plainl: true }));
    return user.get({ plainl: true });
    // const connection = await mysql.createConnection({
